const requestOptions = {
  method: "GET",
  redirect: "follow",
};

fetch(
  "https://maps.googleapis.com/maps/api/place/textsearch/json?query=restaurant&location=-26.1507068%2C28.367639&radius=50000&key=AIzaSyBCL1EwLHgn8s3qXIk-rTVtr3DW3P8ZHR4",
  requestOptions
)
  .then((response) => response.text())
  .then((result) => console.log(result))
  .catch((error) => console.error(error));
